import { TDocumentDefinitions } from "pdfmake/interfaces";



export const generarCertificado = (curso: string, nombre: string, fecha: string): TDocumentDefinitions => {
    const imageBase64 = "data:image/jpeg;base64,"
    return {
        pageOrientation: 'landscape',
        content: [
          {
            image: imageBase64,
            width: 800, // Ajusta el tamaño para que cubra toda la página
            alignment: 'center',
            margin: [0, 0, 0, 0],
          },
          {
            text: nombre,
            fontSize: 24,
            bold: true,
            alignment: 'center',
            absolutePosition: { x: 0, y: 250 }, // Ajusta la posición vertical
          
          },
          {
            text: `Certificado de participación en el curso: ${curso}`,
            fontSize: 18,
            alignment: 'center',
            absolutePosition: { x: 0, y: 300 }, // Ajusta la posición vertical
   
          },
          {
            text: `Fecha: ${fecha}`,
            fontSize: 14,
            alignment: 'center',
            absolutePosition: { x: 0, y: 350 }, // Ajusta la posición vertical
    
          }
        ],
        styles: {
          header: {
            fontSize: 18,
            bold: true
          },
          subheader: {
            fontSize: 15,
            bold: true
          },
          quote: {
            italics: true
          },
          small: {
            fontSize: 8
          }
        }
      };
    };

    